import React, { useState, useEffect } from 'react';
import './App.css';
import Card from './card';
import axios from 'axios';
import logo from './UI-Screen-1.png'

function App() {

  const [items, setItems] = useState([]);
  const [searchInput, setSearchInput] = useState('');

  useEffect(() => {
    axios.get("http://localhost:4000/cards").then((response) => {
      setItems(response.data);
    });
  }, []);

  const handleSearchChange = (e) => {
    setSearchInput(e.target.value);
  };

  const filteredItems = items.filter(item =>
    item.title.toLowerCase().includes(searchInput.toLowerCase()) ||
    item.description.toLowerCase().includes(searchInput.toLowerCase())
  );

  return (
    <div className="App">
      <header className="App-header">
        <nav>
          <div className="logo"><img src={logo} /> Abstract | Help Center</div>
          <ul>
            <li><button className="request-button">Submit a request</button></li>
          </ul>
        </nav>
      </header>

      <section className="hero">
        <h1>How can we help?</h1>
        <div className="search-box">
          <input
            type="text"
            placeholder="search"
            value={searchInput}
            onChange={handleSearchChange}
          />
          <button onClick className="arrow">→</button>
        </div>
      </section>

      <main>
        <div className="content">
          {filteredItems.map((data, index) => (
            <Card key={index} title={data.title} desc={data.description} />
          ))}
        </div>
      </main>

      <footer className="footer">
        <div className="footer-section">
          <h3>Abstract</h3>
          <ul>
            <li>Branches</li>
          </ul>
        </div>
        <div className="footer-section">
          <h3>Resources</h3>
          <ul>
            <li>Blog</li>
            <li>Help Center</li>
            <li>Release Notes</li>
            <li>Status</li>
          </ul>
        </div>
        <div className="footer-section">
          <h3>Community</h3>
          <ul>
            <li>Twitter</li>
            <li>LinkedIn</li>
            <li>Facebook</li>
            <li>Dribbble</li>
            <li>Podcast</li>
          </ul>
        </div>
        <div className="footer-section">
          <h3>Company</h3>
          <ul>
            <li>About Us</li>
            <li>Careers</li>
            <li>Legal</li>
            <li>Contact Us: info@abstract.com</li>
          </ul>
        </div>
        <div className="footer-section copyright">
          ©Copyright 2022
          Abstract Studio Design, Inc.
          All rights reserved.
        </div>
      </footer>
    </div>
  );
}

export default App;
